/* eslint-disable jsx-a11y/alt-text */
import React from 'react'

const Home = ()=>{
     return (
         <div className="home">
             <div className="card home-card">
                <h5>Sophia Anderson</h5>
                <div>
                    <img src="https://images.unsplash.com/photo-1614484564972-e37b65b5a573?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80" />

                </div>
             </div>
         </div>
     )
}

export default Home
